import React from "react";
import { BtnComponent } from "./BtnComponent";
import svg from "./SVG/bgButtonStars.svg";

export const BtnForNavigation = () => {
  return (
    <>
      <BtnComponent
        id={"1"}
        data-id={"1"}
        name={"Game"}
        color={"red"}
        image={svg}
      />
      <BtnComponent
        id={"2"}
        data-id={"2"}
        name={"lecture"}
        color={"blue"}
        image={svg}
      />
      <BtnComponent
        id={"3"}
        data-id={"3"}
        name={"materials"}
        color={"yellow"}
        image={svg}
      />
      <BtnComponent
        id={"4"}
        data-id={"4"}
        name={"Homework"}
        color={"purple"}
        image={svg}
      />
    </>
  );
};

